    <div className="header">
      <div className="logo">
        <img src={logo} alt="logo"></img>
      </div>
      <nav className="nav">
        <ul>
          <li>
            <NavLink
              to="/about"
              className={(navData) => (navData.isActive ? "active" : "")}
            >
              Accueil
            </NavLink>
          </li>
          <li>
            <NavLink
            //   to="/about"
            //   className={(navData) => (navData.isActive ? "active" : "")}
            >
              A Propos
            </NavLink>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default Header;
